const qrCode = require("qr-image");

const unesPadangIcon = `
data:image/png;base64,
`;

async function generateQR(qrData, centerImage = undefined) {
    let qr = qrCode.imageSync(qrData, { type: "png"}).toString("base64");
    qr = `data:image/png;base64, ${qr}`;
    return qr;
}

module.exports = {
    unesPadangIcon,
    generateQR
};